import React, { useState } from "react";
import axios from "axios";
import { useNavigate, Link, BrowserRouter as Router, Route, NavLink } from "react-router-dom";

const NavBar = () => {
    return (
        <nav style={{ background: "lightblue", padding: "10px" }}>
            <NavLink to="/home" style={{ marginRight: "10px" }}>Home</NavLink>
            <NavLink to="/service" style={{ marginRight: "10px" }}>Service</NavLink>
            <NavLink to="/contact">Contact</NavLink>
        </nav>
    );
};

const Login = () => {
    const history = useNavigate();
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    async function submit(e) {
        e.preventDefault();
        try {
            const res = await axios.post("http://localhost:5000/", { email, password });
            if (res.data === "exist") {
                history("/home", { state: { id: email } });
            } else if (res.data === "notexist") {
                alert("User has not signed up");
            }
        } catch (error) {
            alert("Wrong details");
            console.log(error);
        }
    }

    const formStyle = {
        width: "300px",
        margin: "auto",
        textAlign: "center",
        border: "1px solid #ccc",
        padding: "20px",
        borderRadius: "5px",
        marginTop: "50px",
        background: "#d3f9d8"
    };

    const inputStyle = {
        width: "100%",
        marginBottom: "10px",
        padding: "8px"
    };

    const submitButtonStyle = {
        width: "100%",
        padding: "10px",
        background: "#007bff",
        color: "#fff",
        border: "none",
        borderRadius: "5px",
        cursor: "pointer"
    };

    const linkStyle = {
        textDecoration: "none",
        color: "#007bff"
    };

    return (
        <div>
            <NavBar />
            <div className="login" style={{ textAlign: "center", background: "#d3f9d8", height: "100vh", paddingTop: "50px" }}>
                <h1 style={{ marginBottom: "30px" }}>Login</h1>
                <form action="POST" style={formStyle}>
                    <input type="email" onChange={(e) => setEmail(e.target.value)} placeholder="Email" style={inputStyle} />
                    <input type="password" onChange={(e) => setPassword(e.target.value)} placeholder="Password" style={inputStyle} />
                    <input type="submit" onClick={submit} style={submitButtonStyle} />
                </form>
                <br />
                <p>OR</p>
                <br />
                <Link to="/signup" style={linkStyle}>Signup Page</Link>
            </div>
        </div>
    );
};

const Home = () => {
    return <h1>Home Page</h1>;
};

const Service = () => {
    return <h1>Service Page</h1>;
};

const Contact = () => {
    return <h1>Contact Page</h1>;
};

const App = () => {
    return (
        <Router>
            <Route exact path="/" component={Login} />
            <Route path="/home" component={Home} />
            <Route path="/service" component={Service} />
            <Route path="/contact" component={Contact} />
        </Router>
    );
};

export default App;
